#23 - To what extent would a brilliant young chemist go to win his love? Also...&quot;The Repulsive Dwarf&quot;.

#24 - Archie Krisler was hemmed in by a wall of molten flame - his fingers immobilized! There was no way to give the cry of alarm - to warn of the blaze that would make a pyre of his body!

#25 - In a matter of minutes the seasurf became a steel coffin forty fathoms down. Thirty-five trapped men had but a single hope: their lives depended on the navy divers. In their hands was life or cold...DEEP DEATH!

#26 - Joe Brent and Judy Carr...just a couple of ordinary young people with little more than their love for each other and their big plans for the future. But suddenly, through a curious chain of circumstances, they found themselves involved in a terrifying, unforgettable situation that would chill the bravest of hearts...all because Joe and Judy yielded momentarily to TEMPTATION!

